import React from 'react'
import axios from 'axios'

const vids = ({ featured }) => {
    console.log(featured);
    return (
        <div>

        </div>
    )
}

export default vids;

export async function getStaticProps({ params }) {

    if(params.category === 'hiphop'){
        // var key = process.env.YOUTUBE_API_KEY;
        // let response = await axios.get(`https://www.googleapis.com/youtube/v3/search?part=snippet&maxResults=20&q=popular%20hiphop%20music%20videos&key=${key}`)
        var response = await axios.get(`https://itunes.apple.com/lookup?id=158038,486597,994656,5040714&entity=album&limit=3`);
        var featured  = await response.data;

        return { props: { featured } }
      }
}


export async function getStaticPaths() {

    return { paths: [
      { params: { category: 'hiphop' } }
    ], fallback: false }
  }
